-- Table structure for table `users`
--

DROP TABLE IF EXISTS `users`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `users` (
  `user_id` tinyint unsigned NOT NULL AUTO_INCREMENT,
  `usu_personid` varchar(15) NOT NULL,
  `usu_profileid` tinyint unsigned NOT NULL,
  `usu_specialty` varchar(45) NOT NULL,
  `usu_colegiatura` varchar(45) NOT NULL,
  `usu_login` varchar(10) NOT NULL,
  `usu_password` varchar(32) NOT NULL,
  `usu_photo` longblob,
  `usu_createtime` datetime DEFAULT NULL,
  `usu_edittime` datetime DEFAULT NULL,
  `usu_canceltime` datetime DEFAULT NULL,
  `usu_state` tinyint unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`user_id`),
  KEY `FK_Usu_Perfil_idx` (`usu_profileid`) /*!80000 INVISIBLE */,
  KEY `FK_usu_estado_idx` (`usu_state`),
  KEY `FK_usu_perId_idx` (`usu_personid`),
  CONSTRAINT `FK_usu_estado` FOREIGN KEY (`usu_state`) REFERENCES `states` (`est_id`),
  CONSTRAINT `FK_usu_Perfil` FOREIGN KEY (`usu_profileid`) REFERENCES `profile` (`profile_id`),
  CONSTRAINT `FK_usu_perId` FOREIGN KEY (`usu_personid`) REFERENCES `persons` (`person_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
